import axios from 'axios'
function Carrer() {
    const getting=async()=>{
      await fetch('https://jsonplaceholder.typicode.com/posts')
      .then((res)=>{
        console.log(res)
      })
    }

    const posting=async()=>{
          await axios.post('https://jsonplaceholder.typicode.com/posts')
          .then((r)=>{
            console.log(r.data)
            console.log('new on ')
          })
    }
    useEffect(()=>{
        getting()
        posting()
    },[])
